import styled from "styled-components";

const H1 = styled.h1`
  font-size: var(--fs-700);
  color: var(--gray-color-1);
`;

const H2 = styled.h2`
  font-size: var(--fs-600);
  color: var(--gray-color-1);
`;

const H3 = styled.h3`
  font-size: var(--fs-500);
  color: var(--blue-color-4);
`;

const H4 = styled.h4`
  font-size: var(--fs-500);
  color: var(--blue-color-4);
`;

const P = styled.p`
  font-size: var(--fs-500);
  color: var(--gray-color-1);
`;

const Typography = { H1, H2, H3,H4, P };

export default Typography;
